  false,\n\t\"url\": null,\n\t\"notes\": \"This report is on the recovery of whooping
  cranes, with a focus on the Aransas-Wood Buffalo population (AWBP). Highlights of
  the report include the whooping crane population rebound from 2010, the whooping
  crane tracking project, more radioed whooping cranes and captive flocks had good
  reproductive seasons.  This report goes in depth into the migration of whooping
  cranes, timing and sightings, management projects at Aransas, resources that threaten
  the flock, and information on the Florida, Louisiana, and Eastern Migratory population
  (EMP), as well as captive flocks.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
